Recapping weddings from 2023 and the first one was Michelle and Andy's at the Peabody Library. The day was nothing short of magical, and one heck of a kickoff to the wedding season.
.
As an avid reader myself, just the phrase "our wedding is in a library" was enough to hook me.  Add to that two utterly lovely human beings getting married, a big grand staircase, and a wonderful team and it REALLY set the tone for an excellent year.
.
Michelle and Andy, I love y'all!
.
